import React, { Component } from 'react';

const ImageView  = ({src,offShow,value}) =>{
    const styleDiv = {
        width:'700px',
        height:'500px',
        zIndex:'100',
        backgroundColor:'white',
        marginLeft:'50%',
        marginTop:'50px',
        transform:'translate(-50%,0)'
    }
    return (
        <div style={styleDiv}>
            <button onClick={()=>offShow(false)}>X</button>
            <img src={src} />
        </div>
    )
}

export default ImageView;
